import { makeStyles } from '@material-ui/core';
const useStyles = makeStyles(() =>({
    popupView :{
        zIndex: '2',
        background: 'rgb(139, 77, 77)',
        position: 'fixed',
        top: '0',
        left: '0',
        bottom: '0',
        right: '0',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    
    popupCard :{
        position: 'relative',
        background: 'white',
        display: 'flex',
        width: '800px',
        height: '500px',
        margin:'20px',
        borderRadius:' 5px',
    },
     product :{
        zIndex: '2',
        background: 'black',
        position: 'relative',
        display: 'flex',
        justifyContent: 'center',
    },
    tablePreview:{
        Width:'800px',
    },
    itemDetails:{
        display:'block',
        color:"red",
    }

}))
export default useStyles;
